atom"],"^6",["^ ","^3","atom","^4","region"],"locations",["^ ","^3","atom","^4",["AW","AF","AO","AL","AD","AE","AR","AM","AS","AG","AU","AT","AZ","BI","BE","BJ","BF","BD","BG","BH","BS","BA","BY","BZ","BM","BO","BR","BB","BN","BT","BW","CF","CA","CH","JG","CL","CN","CI","CM","CD","CG","CO","KM","CV","CR","CU","CW","KY","CY","CZ","DE","DJ","DM","DK","DO","DZ","EC","EG","ER","ES","EE","ET","FI","FJ","FR","FO","FM","GA","GB","GE","GH","GI","GN","GM","GW","GQ","GR","GD","GL","GT","GU","GY","HK","HN","HR","HT","HU","ID","IM","IN","IE","IR","IQ","IS","IL","IT","JM","JO","JP","KZ","KE","KG","KH","KI","KN","KR","KW","LA","LB","LR","LY","LC","LI","LK","LS","LT","LU","LV","MO","MF","MA","MC","MD","MG","MV","MX","MH","MK","ML","MT","MM","ME","MN","MP","MZ","MR","MU","MW","MY","NA","NC","NE","NG","NI","NL","NO","NP","NR","NZ","OM","PK","PA","PE","PH","PW","PG","PL","PR","KP","PT","PY","PS","PF","QA","RO","RU","RW","SA","SD","SN","SG","SB","SL","SV","SM","SO","RS","SS","ST","SR","SK","SI","SE","SZ","SX","SC","SY","TC","TD","TG","TH","TJ","TM","TL","TO","TT","TN","TR","TV","TW","TZ","UG","UA","UY","US","UZ","VC","VE","VG","VI","VN","VU","WS","XK","YE","ZA","ZM","ZW"]],"^5",["^ ","^3","atom","^4","World"],"region",["^ ","^3","atom"]]],"indicatorMeta",["^ ","^:",["^ ","License_Type",["^ ","^3","atom","^4","CC BY-4.0"],"License_URL",["^ ","^3","atom","^4","https://datacatalog.worldbank.org/public-licenses#cc-by"],"WDITable",["^ ","^3","atom","^4","2.18"],"decimal",["^ ","^3","atom","^4",0],"description",["^ ","^3","atom"],"en",["^ ","^3","atom","^4",["^ ","Developmentrelevance","Mortality rates for different age groups (infants, children, and adults) and overall mortality indicators (life expectancy at birth or survival to a given age) are important indicators of health status in a country. Because data on the incidence and prevalence of diseases are frequently unavailable, mortality rates are often used to identify vulnerable populations. And they are among the indicators most frequently used to compare socioeconomic development across countries.","Statisticalconceptandmethodology","Life expectancy at birth used here is the average number of years a newborn is expected to live if mortality patterns at the time of its birth remain constant in the future. It reflects the overall mortality level of a population, and summarizes the mortality pattern that prevails across all age groups in a given year. It is calculated in a period life table which provides a snapshot of a population's mortality pattern at a given time. It therefore does not reflect the mortality pattern that a person actually experiences during his/her life, which can be calculated in a cohort life table.\n\nHigh mortality in young age groups significantly lowers the life expectancy at birth. But if a person survives his/her childhood of high mortality, he/she may live much longer. For example, in a population with a life expectancy at birth of 50, there may be few people dying at age 50. The life expectancy at birth may be low due to the high childhood mortality so that once a person survives his/her childhood, he/she may live much longer than 50 years.","Aggregationmethod","Weighted average","Periodicity","Annual","Topic","Health: Mortality","Source","(1) United Nations Population Division. World Population Prospects: 2017 Revision, or derived from male and female life expectancy at birth from sources such as: (2) Census reports and other statistical publications from national statistical offices, (3) Eurostat: Demographic Statistics, (4) United Nations Statistical Division. Population and Vital Statistics Reprot (various years), (5) U.S. Census Bureau: International Database, and (6) Secretariat of the Pacific Community: Statistics and Demography Programme.","Longdefinition","Life expectancy at birth indicates the number of years a newborn infant would live if prevailing patterns of mortality at the time of its birth were to stay the same throughout its life.","^2H","https://datacatalog.worldbank.org/public-licenses#cc-by","sourceNote","Life expectancy at birth indicates the number of years a newborn infant would live if prevailing patterns of mortality at the time of its birth were to stay the same throughout its life.","^2G","CC BY-4.0","Limitationsandexceptions","Annual data series from United Nations Population Division's World Population Prospects are interpolated data from 5-year period data. Therefore they may not reflect real events as much as observed data.","fullname","Life expectancy at birth, total (years)","sourceOrganization","(1) United Nations Population Division. World Population Prospects: 2017 Revision, or derived from male and female life expectancy at birth from sources such as: (2) Census reports and other statistical publications from national statistical offices, (3) Eurostat: Demographic Statistics, (4) United Nations Statistical Division. Population and Vital Statistics Reprot (various years), (5) U.S. Census Bureau: International Database, and (6) Secretariat of the Pacific Community: Statistics and Demography Programme.","shortname","Life expectancy at birth, total","IndicatorName","Life expectancy at birth, total (years)"]],"^2U",["^ ","^3","atom","^4","Life expectancy at birth, total (years)"],"id",["^ ","^3","atom","^4","SP.DYN.LE00.IN"],"last_year",["^ ","^3","atom","^4",[2017,["DO","PY","MT","KW","IN","KG","CW","TZ","VN","GD","MA","FR","KM","T5","BY","AE","T7","LK","ES","DK","HT","VE","RS","AM","PK","MX","PT","NG","BW","AO","BA","HR","BB","UY","OM","MD","ML","PL","BJ","MV","VU","GR","CY","AU","KZ","ZA","ER","GN","FJ","QA","IE","BH","SC","PA","AF","MK","MG","SK","TO","FM","XK","SB","BN","UG","SR","RW","BI","RO","ME","T3","PG","ZM","IS","GQ","TD","CV","TG","NL","EG","EC","RU","BT","TT","NZ","SG","UZ","CI","SD","MN","MF","MO","SL","KI","NE","FO","TN","GE","BZ","SV","PS","GW","BM","XG","GA","CD","PH","BR","SI","NC","ZT","PR","JG","GY","AL","CU","KE","IL","SN","DZ","SY","SA","TM","ZW","LC","MR","UA","PF","VI"," .IN"]],"^2W",["^ ","^3","atom","^4","Survival to age 65, female"],"^2[",["^ ","^3","atom","^4","2"],"^2S",["^ ","^3","atom","^4","Survival to age 65 refers to the percentage of a cohort of newborn infants that would survive to age 65, if subject to age specific mortality rates of the specified year."],"^2V",["^ ","^3","atom","^4","United Nations Population Division. World Population Prospects: 2017 Revision."],"^30",["^ ","^3","atom"],"^31",["^ ","^3","atom","^4",[["^ ","id","8","^4","Health "],["^ ","id","17","^4","Gender"]]],"^32",["^ ","^3","atom","^4","percent"]],"^23",["^ ","^2G",["^ ","^3","atom","^4","CC BY-4.0"],"^2H",["^ ","^3","atom","^4","https://datacatalog.worldbank.org/public-licenses#cc-by"],"^2I",["^ ","^3","atom","^4","2.1"],"^2J",["^ ","^3","atom","^4",0],"^2K",["^ ","^3","atom"],"en",["^ ","^3","atom","^4",["^ ","^2L","The crude mortality rate is a good indicator of the general health status of a geographic area or population. The crude death rate is not appropriate for comparison of different populations or areas with large differences in age-distributions. Higher crude death rates can be found in some developed countries, despite high life expectancy, because typically these countries have a much higher proportion of older people, due to lower recent birth rates and lower age-specific mortality rates.","^2M","The crude death rate is calculated as the number of deaths in a given period divided by the population exposed to risk of death in that period. For human populations the period is usually one year and, if the population changes in size over the year, the divisor is taken as the population at the mid-year. The rate is usually expressed in terms of 1,000 people: for example, a crude death rate of 9.5 (per 1000 people) in a population of 1 million would imply 9500 deaths per year in the entire population. Subtracting the crude death rate from the crude birth rate provides the rate of natural increase, which is equal to the rate of population change in the absence of migration.\n\nVital rates are based on data from birth and death registration systems, censuses, and sample surveys by national statistical offices and other organizations, or on demographic analysis. Data for the most recent year for some high-income countries are provisional estimates based on vital registers. The estimates for many countries are projections based on extrapolations of levels and trends from earlier years or interpolations of population estimates and projections from the United Nations Population Division.","^2N","Weighted average","^2O","Annual","Shortdefinition","Crude death rate indicates the number of deaths per 1,000 midyear population.","^2P","Health: Population: Dynamics","^2Q","(1) United Nations Population Division. World Population Prospects: 2017 Revision. (2) Census reports and other statistical publications from national statistical offices, (3) Eurostat: Demographic Statistics, (4) United Nations Statistical Division. Population and Vital Statistics Reprot (various years), (5) U.S. Census Bureau: International Database, and (6) Secretariat of the Pacific Community: Statistics and Demography Programme.","^2R","Crude death rate indicates the number of deaths occurring during the year, per 1,000 population estimated at midyear. Subtracting the crude death rate from the crude birth rate provides the rate of natural increase, which is equal to the rate of population change in the absence of migration.","^2H","https://datacatalog.worldbank.org/public-licenses#cc-by","^2S","Crude death rate indicates the number of deaths occurring during the year, per 1,000 population estimated at midyear. Subtracting the crude death rate from the crude birth rate provides the rate of natural increase, which is equal to the rate of population change in the absence of migration.","^2G","CC BY-4.0","^2T","Vital registers are the preferred source for these data, but in many developing countries systems for registering births and deaths are absent or incomplete because of deficiencies in the coverage of events or geographic areas. Many developing countries carry out special household surveys that ask respondents about recent births and deaths. Estimates derived in this way are subject to sampling errors and recall errors.","^2W","Death rate, crude","^2V","(1) United Nations Population Division. World Population Prospects: 2017 Revision. (2) Census reports and other statistical publications from national statistical offices, (3) Eurostat: Demographic Statistics, (4) United Nations Statistical Division. Population and Vital Statistics Reprot (various years), (5) U.S. Census Bureau: International Database, and (6) Secretariat of the Pacific Community: Statistics and Demography Programme.","^2U","Death rate, crude (per 1,000 people)","^2X","Death rate, crude (per 1,000 people)"]],"^2U",["^ ","^3","atom","^4","Death rate, crude (per 1,000 people)"],"id",["^ ","^3","atom","^4","SP.DYN.CDRT.IN"],"^2Y",["^ ","^3","atom","^4",[2017,["DO","PY","MT","KW","IN","KG","CW","TZ","VN","GD","MA","FR","KM","T5","BY","AE","T7","LK","ES","DK","HT","VE","RS","AM","PK","MX","PT","NG","PW","BW","AO","BA","HR","BB","UY","OM","MD","ML","PL","BJ","MV","VU","GR","CY","AU","KZ","ZA","ER","GN","GL","FJ","QA","IE","BH","SC","PA","AF","MK","MG","SK","TO","FM","XK","SB","BN","UG","SR","RW","BI","RO","ME","T3","PG","ZM","IS","GQ","TD","CV","TG","NL","EG","EC","RU","BT","TT","NZ","SG","UZ","CI","SD","MN","MF","MO","SL","KI","NE","FO","TN","GE","BZ","SV","PS","GW","BM","XG","GA","CD","PH","BR","SI","NC","ZT","PR","JG","GY","AL","CU","KE","IL","SN","DZ","SY","SA","TM","ZW","LC","MR","UA","PF","VI","YE","MU","IQ","CF","AR","LS","JO","LV","SE","US","LY","CR","HU","AZ","TH","LR","CL","IR","NI","BF","ET","CH","AG","TJ","EE","BD","ID","LT","GT","GH","LU","BE","NP","KY","AW","GB","MM","CZ","BO","KR","MZ","WS","GU","BS","CN","SS","KP","T6","PE","SZ","CM","CG","DJ","VC","IT","TL","CO","AT","LA","T4","BG","T2","GM","SO","NA","ST","MY","MW","LI" contraceptive prevalence surveys. Unmarried women are often excluded from such surveys, which may bias the estimates.","^2N","Weighted average","^2O","Annual","^2L","Reproductive health is a state of physical and mental well-being in relation to the reproductive system and its functions and processes. Means of achieving reproductive health include education and services during pregnancy and childbirth, safe and effective contraception, and prevention and treatment of sexually transmitted diseases. Complications of pregnancy and childbirth are the leading cause of death and disability among women of reproductive age in developing countries.","^2Q","UNICEF's State of the World's Children and Childinfo, United Nations Population Division's World Contraceptive Use, household surveys including Demographic and Health Surveys and Multiple Indicator Cluster Surveys.","^2R","Contraceptive prevalence rate is the percentage of women who are practicing, or whose sexual partners are practicing, any form of contraception. It is usually measured for women ages 15-49 who are married or in union.","^2H","https://datacatalog.worldbank.org/public-licenses#cc-by","^2S","Contraceptive prevalence rate is the percentage of women who are practicing, or whose sexual partners are practicing, any form of contraception. It is usually measured for women ages 15-49 who are married or in union.","^2G","CC BY-4.0","^2P","Health: Reproductive health","^2U","Contraceptive prevalence, any methods (% of women ages 15-49)","^2V","UNICEF's State of the World's Children and Childinfo, United Nations Population Division's World Contraceptive Use, household surveys including Demographic and Health Surveys and Multiple Indicator Cluster Surveys.","^2W","Contraceptive prevalence, any methods","^2X","Contraceptive prevalence, any methods (% of women ages 15-49)"]],"^2U",["^ ","^3","atom","^4","Contraceptive prevalence, any methods (% of women ages 15-49)"],"id",["^ ","^3","atom","^4","SP.DYN.CONU.ZS"],"^2Y",["^ ","^3","atom","^4",[2018,["MA","PK","NG","BJ","KZ","UG","CI","AL","IQ","JO","BF","ET"]]],"^2Z",["^ ","^3","atom","^4",["SP.DYN.TO65.FE.ZS","SP.DYN.CDRT.IN","SP.DYN.AMRT.MA","SP.DYN.IMRT.IN","SP.DYN.IMRT.MA.IN","SP.DYN.CBRT.IN","SP.DYN.LE00.IN","SP.DYN.TFRT.IN","SP.DYN.AMRT.FE"]],"^2W",["^ ","^3","atom","^4","Contraceptive prevalence, any methods"],"^2[",["^ ","^3","atom","^4","2"],"^2S",["^ ","^3","atom","^4","Contraceptive prevalence rate is the percentage of women who are practicing, or whose sexual partners are practicing, any form of contraception. It is usually measured for women ages 15-49 who are married or in union."],"^2V",["^ ","^3","atom","^4","UNICEF's State of the World's Children and Childinfo, United Nations Population Division's World Contraceptive Use, household surveys including Demographic and Health Surveys and Multiple Indicator Cluster Surveys."],"^30",["^ ","^3","atom"],"^31",["^ ","^3","atom","^4",[["^ ","id","8","^4","Health "],["^ ","id","17","^4","Gender"]]],"^32",["^ ","^3","atom","^4","percent"]],"^25",["^ ","^2G",["^ ","^3","atom","^4","CC BY-4.0"],"^2H",["^ ","^3","atom","^4","https://datacatalog.worldbank.org/public-licenses#cc-by"],"^2I",["^ ","^3","atom","^4","2.18"],"^2J",["^ ","^3","atom","^4",0],"^2K",["^ ","^3","atom"],"en",["^ ","^3","atom","^4",["^ ","^2L","Mortality rates for different age groups (infants, children, and adults) and overall mortality indicators (life expectancy at birth or survival to a given age) are important indicators of health status in a country. Because data on the incidence and prevalence of diseases are frequently unavailable, mortality rates are often used to identify vulnerable populations. And they are among the indicators most frequently used to compare socioeconomic development across countries.","^2M","The main sources of mortality data are vital registration systems and direct or indirect estimates based on sample surveys or censuses. A \"complete\" vital registration system - covering at least 90 percent of vital events in the population - is the best source of age-specific mortality data. Where reliable age-specific mortality data are available, life tables can be constructed from age-specific mortality data, and adult mortality rates can be calculated from life tables.","^2N","Weighted average","^2O","Annual","^2P","Health: Mortality","^2Q","(1) United Nations Population Division. World Population Prospects: 2017 Revision. (2) University of California, Berkeley, and Max Planck Institute for Demographic Research. The Human Mortality Database.","^2R","Adult mortality rate, male, is the probability of dying between the ages of 15 and 60--that is, the probability of a 15-year-old male dying before reaching age 60, if subject to age-specific mortality rates of the specified year between those ages.","^2H","https://datacatalog.worldbank.org/public-licenses#cc-by","^2S","Adult mortality rate, male, is the probability of dying between the ages of 15 and 60--that is, the probability of a 15-year-old male dying before reaching age 60, if subject to age-specific mortality rates of the specified year between those ages.","^2G","CC BY-4.0","^2T","Data from United Nations Population Division's World Populaton Prospects are originally 5-year period data and the presented are linearly interpolated by the World Bank for annual series. Therefore they may not reflect real events as much as observed data.","^2U","Mortality rate, adult, male (per 1,000 male adults)","^2V","(1) United Nations Population Division. World Population Prospects: 2017 Revision. (2) University of California, Berkeley, and Max Planck Institute for Demographic Research. The Human Mortality Database.","^2W","Mortality rate, adult, male","^2X","Mortality rate, adult, male (per 1,000 male adults)"]],"^2U",["^ ","^3","atom","^4","Mortality rate, adult, male (per 1,000 male adults)"],"id",["^ ","^3","atom","^4","SP.DYN.AMRT.MA"],"^2Y",["^ ","^3","atom","^4",[2017,["DO","PY","MT","KW","IN","KG","CW","TZ","VN","GD","MA","KM","T5","AE","LK","HT","VE","RS","AM","PK","MX","NG","BW","AO","BA","HR","BB","UY","OM","MD","ML","BJ","MV","VU","GR","CY","KZ","ZA","ER","GN","FJ","QA","BH","SC","PA","AF","MK","MG","TO","FM","SB","BN","UG","SR","RW","BI","RO","ME","T3","PG","ZM","GQ","TD","CV","TG","EG","EC","BT","TT","SG","UZ","CI","SD","MN","MO","SL","KI","NE","TN","GE","BZ","SV","PS","GW","XG","GA","CD","PH","BR","NC","ZT","PR","JG","GY","AL","CU","KE","SN","DZ","SY","SA","TM","ZW","LC","MR","PF","VI","YE","MU","IQ","CF","AR","LS","JO","LV","LY","CR","HU","AZ","TH","LR","CL","IR","NI","BF","ET","AG","TJ","EE","BD","ID","LT","GT","GH","NP","AW","MM","BO","KR","MZ","WS","GU","BS","CN","SS","KP","T6","PE","SZ","CM","CG","DJ","VC","TL","CO","AT","LA","T4","T2","GM","SO","NA","ST","MY","MW","LB","JM","KH","HN","HK","TR"]]],"^2Z",["^ ","^3","atom","^4",["SP.DYN.AMRT.FE","SP.DYN.TO65.FE.ZS","SP.DYN.CDRT.IN","SP.DYN.CONU.ZS","SP.DYN.IMRT.IN","SP.DYN.IMRT.MA.IN","SP.DYN.CBRT.IN","SP.DYN.LE00.IN","SP.DYN.TFRT.IN"]],"^2W",["^ ","^3","atom","^4","Mortality rate, adult, male"],"^2[",["^ ","^3","atom","^4","2"],"^2S",["^ ","^3","atom","^4","Adult mortality rate, male, is the probability of dying between the ages of 15 and 60--that is, the probability of a 15-year-old male dying before reaching age 60, if subject to age-specific mortality rates of the specified year between those ages."],"^2V",["^ ","^3","atom","^4","(1) United Nations Population Division. World Population Prospects: 2017 Revision. (2) University of California, Berkeley, and Max Planck Institute for Demographic Research. The Human Mortality Database."],"^30",["^ ","^3","atom"],"^31",["^ ","^3","atom","^4",[["^ ","id","8","^4","Health "],["^ ","id","17","^4","Gender"]]],"^32",["^ ","^3","atom","^4","unknown"]],"^26",["^ ","^2G",["^ ","^3","atom","^4","CC BY-4.0"],"^2H",["^ ","^3","atom","^4","https://datacatalog.worldbank.org/public-licenses#cc-by"],"^2I",["^ ","^3","atom","^4","2.18"],"^2J",["^ ","^3","atom","^4",0],"^2K",["^ ","^3","atom"],"en",["^ ","^3","atom","^4",["^ ","^34","Given that data on the incidence and prevalence of diseases are frequently unavailable, mortality rates are often used to identify vulnerable populations. Moreover, they are among the indicators most frequently used to compare socioeconomic development across countries. Under-five mortality rates are higher for boys than for girls in countries in which parental gender preferences are insignificant. Under-five mortality captures the effect of gender discrimination better than infant mortality does, as malnutrition and medical interventions have more significant impacts to this age group. Where female under-five mortality is higher, girls are likely to have less access to resources than boys.","^2M","The main sources of mortality data are vital registration systems and direct or indirect estimates based on sample surveys or censuses. A \"complete\" vital registration system - covering at least 90 percent of vital events in the population - is the best source of age-specific mortality data.\n\nEstimates of neonatal, infant, and child mortality tend to vary by source and method for a given time and place. Years for available estimates also vary by country, making comparisons across countries and over time difficult. To make neonatal, infant, and child mortality estimates comparable and to ensure consistency across estimates by different agencies, the United Nations Inter-agency Group for Child Mortality Estimation (UN IGME), which comprises the United Nations Children's Fund (UNICEF), the World Health Organization (WHO), the World Bank, the United Nations Population Division, and other universities and research institutes, developed and adopted a statistical method that uses all available information to reconcile differences. The method uses statistical models to obtain a best estimate trend line by fitting a country-specific regression model of mortality rates against their reference dates.","^2N","Weighted average","^2O","Annual","^2G","CC BY-4.0","^2L","Mortality rates for different age groups (infants, children, and adults) and overall mortality indicators (life expectancy at birth or survival to a given age) are important indicators of health status in a country. Because data on the incidence and prevalence of diseases are frequently unavailable, mortality rates are often used to identify vulnerable populations. And they are among the indicators most frequently used to compare socioeconomic development across countries.","^2Q","Estimates developed by the UN Inter-agency Group for Child Mortality Estimation (UNICEF, WHO, World Bank, UN DESA Population Division) at www.childmortality.org.","^2R","Infant mortality rate is the number of infants dying before reaching one year of age, per 1,000 live births in a given year.","^2H","https://datacatalog.worldbank.org/public-licenses#cc-by","^2S","Infant mortality rate is the number of infants dying before reaching one year of age, per 1,000 live births in a given year.","^2T","Complete vital registration systems are fairly uncommon in developing countries. Thus estimates must be obtained from sample surveys or derived by applying indirect estimation techniques to registration, census, or survey data. Survey data are subject to recall error, and surveys estimating infant/child deaths require large samples because households in which a birth has occurred during a given year cannot ordinarily be preselected for sampling. Indirect estimates rely on model life tables that may be inappropriate for the population concerned. Extrapolations based on outdated surveys may not be reliable for monitoring changes in health status or for comparative analytical work.","^2P","Health: Mortality","^2W","Mortality rate, infant","^2V","Estimates developed by the UN Inter-agency Group for Child Mortality Estimation (UNICEF, WHO, World Bank, UN DESA Population Division) at www.childmortality.org.","^2U","Mortality rate, infant (per 1,000 live births)","^2X","Mortality rate, infant (per 1,000 live births)"]],"^2U",["^ ","^3","atom","^4","Mortality rate, infant (per 1,000 live births)"],"id",["^ ","^3","atom","^4","SP.DYN.IMRT.IN"],"^2Y",["^ ","^3","atom","^4",[2017,["DO","PY","MT","KW","IN","KG","TZ","VN","GD","TV","MA","FR","KM","T5","BY","AE","T7","LK","ES","DK","HT","VE","RS","AM","PK","MX","DM","PT","NG","PW","BW","AO","BA","HR","BB","UY","OM","MD","ML","PL","BJ","MV","VU","GR","CY","AU","KZ","ZA","ER","GN","FJ","QA","IE","BH","SC","PA","AF","MK","MG","SK","TO","FM","SB","BN","UG","SR","RW","BI","RO","ME","T3","PG","ZM","IS","GQ","TD","CV","TG","NL","EG","EC","RU","BT","TT","NZ","SG","UZ","CI","SD","MN","SL","KI","NE","TN","GE","BZ","SV","PS","GW","XG","GA","CD","PH","BR","SI","ZT","GY","AL","CU","KE","IL","NR","SN","DZ","SY","SA","TM","ZW","LC","MR","UA","YE","MU","IQ","CF","AR","LS","JO","LV","SE","US","LY","CR","HU","AZ","TH","LR","CL","IR","NI","BF","ET","CH","AG","TJ","EE","BD","ID","LT","GT","GH","LU","MC","BE","NP","GB","MM","CZ","BO","KR","AD","MZ","WS","BS","CN","SS","KP","T6","PE","SZ","CM","CG","SM","DJ","KN","VC","IT","TL","CO","AT","LA","T4","BG","T2","GM","SO","NA","ST","MY","MW","CA","LB","NO","JP","FI","JM","MH","KH","HN","DE","TR"]]],"^2Z",["^ ","^3","atom","^4",["SP.DYN.IMRT.MA.IN","SP.DYN.IMRT.FE.IN","SP.DYN.TO65.FE.ZS","SP.DYN.CDRT.IN","SP.DYN.CONU.ZS","SP.DYN.AMRT.MA","SP.DYN.CBRT.IN","SP.DYN.LE00.IN","SP.DYN.TFRT.IN"]],"^2W",["^ ","^3","atom","^4","Mortality rate, infant"],"^2[",["^ ","^3","atom","^4","2"],"^2S",["^ ","^3","atom","^4","Infant mortality rate is the number of infants dying before reaching one year of age, per 1,000 live births in a given year."],"^2V",["^ ","^3","atom","^4","Estimates developed by the UN Inter-agency Group for Child Mortality Estimation (UNICEF, WHO, World Bank, UN DESA Population Division) at www.childmortality.org."],"^30",["^ ","^3","atom"],"^31",["^ ","^3","atom","^4",[["^ ","id","8","^4","Health "]]],"^32",["^ ","^3","atom","^4","unknown"]],"^27",[
